import './navbar.css'

export default function Navbar() {
  return (

    <header class="header-background"> 
	    <h1> Carter's Concoctions </h1>
	    <nav>
            <a href="index.html">Home</a>
            <a href="about-me.html">About Me</a>
	    </nav>
	</header>
  );
}
